import React from 'react';
import Button from '../Button/Button';
import Title from '../Title/Title';
const Card = (props) => {
   const { image, title, goto } = props;
   return (
      <div className='card'>
         <div className='card__img mb--s'>
            <img src={`${image}`} alt={title} />
         </div>
          <div className='card__text'>

            <div>

               {!!title && (
                <Title headingStyle='bolder--800' headingSize='heading--h4'>
                  {title}
               </Title>
               )}
            </div>

            <a href={`${goto}`}></a>

            <Button
               type='button'

               buttonSize='btn--small'
            >
               See WebSite
            </Button>
         </div> 
      </div>
   );
};

export default Card;
